1.  General  biomedical  subject  matter  knowledge:  biomedical  data  scientists  should 
have  a  general  working  knowledge  of  the  principles  of  biology,  bioinformatics,  and 
basic clinical science;

3.  Predictive  analytics,  modeling,  and  machine  learning:  while  a  range  of  statistical 
methods may be useful, predictive analytics, modeling, and machine learning emerged 
as especially important skills in biomedical data science;
